import React, { Component, useState } from 'react';

const Button = ({ title, pageNumber, rows }) => {
  let disabled;
  if (pageNumber <= 1 || pageNumber >= rows.length) {
    disabled = true
  }
  return (
    <button disabled={!!disabled}>
      {title}
    </button>
  )
}


export default Button
